import { Card, CardContent } from '@material-ui/core';

function MyCard(props) {
  if (props.highlight) {
    return (
      <Card variant="outlined" color="red"> 
        <CardContent>
          {props.value}
        </CardContent>
      </Card>
      );
  } else {
    return (
      <Card> 
        <CardContent>
          {props.value}
        </CardContent>
      </Card>
      );
  }

}

export default MyCard;
